import React from 'react'

const TodosList = ({todos, setTodos}) => {
  return (
    <div>
        {todos.map((todo) => (
            <li className='list-item' key={todo.id}>
                <input 
                  type="text" 
                  value = {todo.title} 
                  className= "list" 
                  onChange={(e) => e.preventDefault()} 
                />
               <div class="todo "><button class="complete-btn"><i class="fas fa-check-circle"></i></button><li class="todo-item">xbbxc</li><button class="trash-btn"><i class="fa fa-minus-circle"></i></button></div>
            </li>
        ))}
    </div>
  );
};

export default TodosList
